class Solution:
    def moveZeroes(self, nums: list) -> None:

        """
        Do not return anything, modify nums in-place instead.
        """
        addIndex = None
        waitIndex = 0
        for i in range(0, len(nums)):
            if nums[i] == 0:
                if addIndex !=None:
                    waitIndex+=1
                else:
                    addIndex = i
            else:
                if addIndex !=None:
                    nums[i],nums[addIndex] = nums[addIndex],nums[i]
                    if waitIndex>0:
                        addIndex+=1
                    else:
                        addIndex = i
        # print(nums)


